import React, { Component } from "react";

class ItemCard extends Component {
    constructor(props) {
        super(props);         
      }
      render(){
        return(
          <div>
            <h3>
              a
              {this.props.title}
            </h3>
          </div>

        );
      }
}
export default ItemCard;
